INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (10021, 0.0, 24015, 0.0, "2019/07/31 12:00:00", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2030/12/17 14:59:59", 24, 4, 4, "カオリ（サマー）", 110501, 0.0, 1);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (10021, 0.0, 24016, 0.0, "2019/07/31 12:00:00", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2030/12/17 14:59:59", 24, 4, 1, "カオリ（サマー）", 110501, 4.0, 2);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (10021, 0.0, 24017, 0.0, "2019/07/31 12:00:00", "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2030/12/17 14:59:59", 24, 4, 4, "カオリ（サマー）", 110501, 0.0, 3);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (10021, 0.0, 24018, 0.0, "2019/07/31 12:00:00", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2030/12/17 14:59:59", 24, 1, 2, "カオリ（サマー）", 110501, 5.2, 4);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (10021, 0.0, 24019, 0.0, "2019/07/31 12:00:00", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2030/12/17 14:59:59", 24, 5, 6, "カオリ（サマー）", 110501, 4.2, 5);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (10021, 0.0, 24020, 0.0, "2019/07/31 12:00:00", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2030/12/17 14:59:59", 24, 2, 2, "カオリ（サマー）", 110501, 0.0, 6);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (10021, 0.0, 24021, 0.0, "2019/07/31 12:00:00", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2030/12/17 14:59:59", 24, 1, 6, "カオリ（サマー）", 110501, 6.4, 7);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (10021, 0.0, 24022, 0.0, "2019/07/31 12:00:00", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2030/12/17 14:59:59", 24, 2, 2, "カオリ（サマー）", 110501, 0.0, 8);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (10021, 0.0, 24023, 0.0, "2019/07/31 12:00:00", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2030/12/17 14:59:59", 24, 6, 3, "カオリ（サマー）", 110501, 10.08, 9);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (10021, 0.0, 24024, 0.0, "2019/07/31 12:00:00", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2030/12/17 14:59:59", 24, 1, 2, "カオリ（サマー）", 110501, 5.0, 10);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (10021, 0.0, 24025, 0.0, "2019/07/31 12:00:00", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2030/12/17 14:59:59", 24, 2, 2, "カオリ（サマー）", 110501, 0.0, 11);
